        function startAnimation() {
            const videoDuration = video.duration; // Get the total duration of the video

            // Update animation at regular intervals (e.g., every 100ms)
            setInterval(() => {
                const currentTime = video.currentTime; // Get the current time of the video
                const closestDataPoint = getClosestDataPoint(currentTime); // Get the closest data point in the data

                // Get the frequency from the closest data point
                const frequency = closestDataPoint ? closestDataPoint.frequency : 0;

                if (frequency !== undefined) {
                    // Use the frequency data to animate the text
                    const scale = 1 + (frequency / 100); // Pulse scale factor based on frequency
                    text.style.transform = `scale(${scale})`;
                }
            }, 100); // Adjust the interval as needed
        }

        function getClosestDataPoint(currentTime) {
            // Find the closest timestamp to the current time in the video
            let closestDataPoint = frequencyData[0];
            let minDifference = Math.abs(currentTime - closestDataPoint.timestamp);

            frequencyData.forEach(dataPoint => {
                const timeDifference = Math.abs(currentTime - dataPoint.timestamp);
                if (timeDifference < minDifference) {
                    closestDataPoint = dataPoint;
                    minDifference = timeDifference;
                }
            });

            return closestDataPoint;
        }

        // Start animation once video is ready
        video.onload = () => {
            startAnimation();
        };
    </script>
